import React from 'react';
import './styles.css';
import { ReactComponent as TwitterSVG } from '../assets/icons/twitter.svg';
import { ReactComponent as GithubSVG } from '../assets/icons/github.svg';
import { ReactComponent as LinkedinSVG } from '../assets/icons/linkedin.svg';

const contact = {
    backgroundColor: "#001f3f",
    width: "100%",

}

const text = {
    color: "white",
    fill: "white",
}

const info = {
    margin: "50px",
    display: "flex",
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "center",
}

export default function Contact() {
    return (
        <div className="Body">
            <div style={contact}>
                <div style={info}>
                    <svg style={text}> <TwitterSVG /> </svg>
                    <svg> <LinkedinSVG /> </svg>
                    <svg> <GithubSVG /></svg>
                </div>
                <h4 style={text}>Nikolaj Johannes Skole Jensen</h4>
                <h5 style={text}>nikolajjsj@gmail.com</h5>
                <h5 style={text}>nikolaj.app.dev@gmail.com</h5>
            </div>
        </div>
    )
}
